import React from "react";

const DetailedData = ({ selectedRow }) => {
  if (!selectedRow) return null;


  const { author } = selectedRow;

  return (
    <div className="detailed-data">
      <h2>Books by {author}</h2>
      {}
    </div>
  );
};

export default DetailedData;
